window.bookSummaryJSON = "<p>Why are some people more successful than others? Self-confidence! What one great goal would you set if you knew you could not fail? What wonderful things would you want to do with your life if you were guaranteed success in anything you attempted? Your level of self-confidence determines the size of the goals you set, the energy and determination that you focus on achieving them, and the amount of persistence you apply to overcoming every obstacle. </p> <p>In this powerful, practical audiobook based on work with more than five million executives, entrepreneurs, sales professionals, and ambitious people in more than 60 countries, you learn how to develop unshakable self-confidence in every area of your life. </p> <p><i>The Power of Self-Confidence</i> explains how to increase your \"mental fitness\" by thinking like top performers in every field. Little by little, you build up and maintain ever-higher levels of self-confidence in everything you do. Self-confidence allows you to move out of your comfort zone and take risks without any guarantees. </p> <p>With step-by-step guidance, author Brian Tracy will help you build the foundations of lifelong self-confidence. You discover how to determine what you really want, and unleash your personal powers to accomplish it. You'll learn how to: clarify and live consistently with your values to become the very best person you could possibly be; set clear goals and make written plans to accomplish them; commit yourself to mastery in your chosen field and to lifelong personal improvement; program your subconscious mind to respond in a positive and constructive way to every problem or difficulty; minimize your weaknesses and maximize your strengths for higher achievement; develop high levels of courage and incredible persistence; become unstoppable, irresistible, and unafraid in every area of your life through the power of unshakable self-confidence. </p> <p>Become a person of action, overcome any obstacle, and scale any height. With your newfound unshakable self-confidence, you will accomplish every goal you can set for yourself.</p>"; 
